import React, { Component } from 'react';
import Layout from '../components/Layout';

class Dodaj_akorde extends React.Component{
      render() {
            return (
                  <Layout>
                        <div>Dodaj akordE</div>
                  </Layout>
            )
      }
}

export default Dodaj_akorde;
